INSERT INTO `wp_posts` VALUES (48,1,'2025-06-07 21:05:48','2025-06-07 21:05:48','<!-- wp:paragraph -->\n<p><strong>The First-ever Tampere Torisits will take place on 14.6.2025! We welcome you to experience an unforgettable summer night at Tampere Torisits at Keskustori Central Square, where the singing is thunderous and sitsing folk fill the town square!</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Torisits will bring visibility to the lively student culture at the Keskustori Central Square of Tampere. Students from all campuses of Tampere University and Tampere University of Applied Sciences gather together in a multidisciplinary spirit  everyone is welcome: teekkarit, humanists, applied sciences students, freshers, year N students and alumni. We cheerily invite all personnel from the Tampere Universities community to take part in the sits, as well! The first open space Torisits of Tampere are unparalleled experience where you get to celebrate the higher education students community!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sits are an academic celebration that includes a three-course dinner, speeches, greetings, songs and student atmosphere. To locals and travellers, Torisits will present living student culture at its best. As the sits are taking place at a prime location, the Keskustori Central Square in an open space, they are a spectacle which anyone can view from the sidelines and even sing-along to familiar sits songs.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As event participation is also possible in a wheelchair, for example, we kindly ask you to state this when purchasing your ticket. If you need special accessibility arrangements, please notify the organiser beforehand via the ticket purchase form, so we will arrange an accessible toilet during the event, for example.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We follow the principles for a safe space in the event. The event is harassment free. If you encounter harassment, bullying or inappropriate behaviour of any kind, you can contact TREYs harassment contact persons through&nbsp;<a href=\"mailto:hairinta@trey.fi\">hairinta@trey.fi</a>.&nbsp;<a href=\"https://forms.office.com/r/M8bCEPwswc\">Harassment contact persons can also be reached via this Microsoft Forms contact form.</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Questions regarding the event can be directed at&nbsp;<a href=\"mailto:tapahtumat@trey.fi\">tapahtumat@trey.fi</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul class=\"wp-block-list\"><!-- wp:list-item -->\n<li>What: Torisits</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Where: Keskustori Central Square</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>When: 14 June 2025 at 16.00-20.00</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Why: Because summer and sitsing rock!</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Thank you Academic Engineers and Architects in Finland TEK for supporting the event!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://trey.fi/en/community/events-calendar/torisits\">More info on Torisits can be found on TREY\'s website!</a></p>\n<!-- /wp:paragraph -->','Torisits','','publish','open','closed','','torisits','','','2025-06-07 22:31:19','2025-06-07 22:31:19','',0,'http://meponetv1.local/?post_type=event&#038;p=48',0,'event','',1);
