INSERT INTO `wp_posts` VALUES (50,1,'2025-06-07 21:08:45','2025-06-07 21:08:45','<!-- wp:paragraph -->\n<p><strong>We are looking for student participants to test a collaboration game and share their experiences. Food and drinks are on us!</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><em>Imagine that you live on a mysterious island covered with a beautiful forest full of green trees and tasty berries. Soon you discover also that the ground is rich with coal deposits.&nbsp; You and other inhabitants of New Shores will try to organize your life in a way that suits you and other members of the community.&nbsp;</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We are looking for&nbsp;<strong>student participants to test a digital collaboration game and provide feedback on the experience</strong>. As a compensation&nbsp;<strong>we will provide drinks and snacks&nbsp;</strong>to keep your tummy satisfied.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The game test session will be in&nbsp;<strong>Hervanta campus, Tietotalo on Friday 9th of May at 10:00 - 12:00&nbsp;</strong>(exact location is provided to the attendees).&nbsp;<strong>Participants should be between 16-25 years to attend and be able to communicate in English</strong>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://eur04.safelinks.protection.outlook.com/?url=https%3A%2F%2Fforms.office.com%2FPages%2FResponsePage.aspx%3Fid%3Dr0Rp-nzM2EyRVMARMnmJEOBQNIAnVT9MoeB5k3dx9Y5UQ0s4UDgzQlZLNUozMlRLVDFEOUFCRVMzVC4u&amp;data=05%7C02%7Cjari.varsaluoma%40tuni.fi%7C18d6943d7ee74d17bf2608dd8653a2c7%7Cfa6944afcc7c4cd89154c01132798910%7C0%7C0%7C638814415958697621%7CUnknown%7CTWFpbGZsb3d8eyJFbXB0eU1hcGkiOnRydWUsIlYiOiIwLjAuMDAwMCIsIlAiOiJXaW4zMiIsIkFOIjoiTWFpbCIsIldUIjoyfQ%3D%3D%7C0%7C%7C%7C&amp;sdata=VQCY9B7474LUI%2Fqnr1trSXcqyuxD%2FQf%2F8ckBhFF1GZw%3D&amp;reserved=0\"><strong>Enroll to the game testing session here.</strong></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This study is part of EU funded Erasmus+ GameIN project (Gamified and Digital Methods for Youth Participation, 2024-1-FI01-KA220-YOU-000250538). We will anonymize our observation, notes and your feedback in such a way that no single participant can be identified.&nbsp; Only GameIN project members can access the collected data. Project members are Youth academy and Tampere university (Finland), National Youth Council Eesti Noortehenduste Liit MT (Estonia), Libera Palermo Associazione (Italy) and Youth Power (Bosnia and Herzegovina).<br><br>You can stop participating in the workshop at any point, in which case we will not use your feedback. The collected personal data is stored in password protected web server at Tampere universitys Microsoft 365 account. Collected personal data is deleted on 31.12.2026 at the latest. Results are used in publications from the project partners to support youth societal participation in Europe. Please see privacy notice attached.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you have any questions about the study, please contact:&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>University lecturer Jari Varsaluoma, Tampere university,&nbsp;<a href=\"mailto:jari.varsaluoma@tuni.fi\">jari.varsaluoma@tuni.fi</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://eur04.safelinks.protection.outlook.com/?url=https%3A%2F%2Fforms.office.com%2FPages%2FResponsePage.aspx%3Fid%3Dr0Rp-nzM2EyRVMARMnmJEOBQNIAnVT9MoeB5k3dx9Y5UQ0s4UDgzQlZLNUozMlRLVDFEOUFCRVMzVC4u&amp;data=05%7C02%7Cjari.varsaluoma%40tuni.fi%7C18d6943d7ee74d17bf2608dd8653a2c7%7Cfa6944afcc7c4cd89154c01132798910%7C0%7C0%7C638814415958721730%7CUnknown%7CTWFpbGZsb3d8eyJFbXB0eU1hcGkiOnRydWUsIlYiOiIwLjAuMDAwMCIsIlAiOiJXaW4zMiIsIkFOIjoiTWFpbCIsIldUIjoyfQ%3D%3D%7C0%7C%7C%7C&amp;sdata=yqU3vxJytefkML7MCAOQAxa9fdgGFzSaZ9n9Qxvr7OQ%3D&amp;reserved=0\"><strong>Enroll to the game testing session here.</strong></a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will contact each participant to confirm their enrollment and provide further instructions.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br>Thank you for your participation!</p>\n<!-- /wp:paragraph -->','Join a game testing session for students','','publish','open','closed','','join-a-game-testing-session-for-students','','','2025-06-07 22:32:09','2025-06-07 22:32:09','',0,'http://meponetv1.local/?post_type=project&#038;p=50',0,'project','',0);
