INSERT INTO `wp_posts` VALUES (64,1,'2025-06-08 18:31:27','2025-06-08 18:31:27','<!-- wp:paragraph -->\n<p><strong>We warmly welcome researchers of all career stages, from PhD students to world-leading professors to join us at the 6th ERC Grantees Conference on 10-12.06.2025 in Porvoo, Finland this summer.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The research theme of the 6th ERC grantees conference will be <strong>From Responsive Molecules to Interactive Materials</strong>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Registration will be opened in February 2025 after sending abstract acceptance notifications.&nbsp;<strong>Registration deadline is March 31st 2025.</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>More information and registration&nbsp;<a href=\"https://events.tuni.fi/erc2025/\" target=\"_blank\" rel=\"noreferrer noopener\">on the event web pages.</a></p>\n<!-- /wp:paragraph -->','The 6th ERC Grantees Conference 2025','','publish','open','closed','','the-6th-erc-grantees-conference-2025','','','2025-06-08 18:31:28','2025-06-08 18:31:28','',0,'http://meponetv1.local/?post_type=event&#038;p=64',0,'event','',0);
