INSERT INTO `wp_posts` VALUES (81,1,'2025-06-09 03:24:25','2025-06-09 03:24:25','<span class=\"sc-dGHkRN dfcAXi\" style=\"line-height: 1.875rem;font-weight: bold;font-size: 1.25rem;margin: 1.875rem 0px 1.25rem;color: #000000\">We warmly welcome you to participate in an online course titled \"Start to Finnish. This self-learning experience is designed exclusively for forward-thinking students eager to understand the nuances of the culture, practices, and legislation of working in Finland. The Start to Finnish course is moderated and designed by Akava, the Confederation of Unions for Professional and Managerial Staff in Finland, in co-operation with universities and universities of applied sciences across the country.</span>\r\n<div class=\"sc-kpDqfm bUQqyj\" style=\"color: #000000\">\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">Course Duration &amp; Structure:</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">The course is organized entirely online and there are no joint lectures during the course. The course materials are available in an online platform (Howspace) where you will move forward at your own pace. You will have access to the materials for the duration of your studies or as long as your study institution is in cooperation with Akava.</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">The course structure consists of the following learning modules:</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">- Features of Finnish Society  orientation module</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">- When looking for work -module</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">- When starting work module</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">- When working -module</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">- When work ends -module</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">Each learning module includes 5 or 6 chapters. Additionally, in the Howspace -platform, you will be required to read through the Welcome page with instructions, as well as complete the Feedback-page at the end of the course. Completing the course requires approximately 20-25 hours of work.</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">Please note that this is not a Finnish language course. The course is only available in English.</p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">Mandatory tasks</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">To receive a certificate of completion from the course, you will need to complete the following tasks:</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">- Read through all the content of the course</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">- Complete mandatory Your turn -tasks in each module</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">- Reflect on what you have learned at the end of each module</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">- Complete the course feedback</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">There are no lectures during the course. However, the course platform encourage discussion and sharing experiences. Your turn -tasks will provide the opportunity to connect with students from every corner of Finland. All discussions are also moderated, and your privacy has been considered.</p>\r\n\r\n<h3 style=\"margin: 1.25rem 0px;font-size: 24px;line-height: 1.25\">The use of AI during the course</h3>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">The use of AI is not prohibited during the course, and AI tools are used also on the course platform. However, we strongly discourage relying on just AI instead of your own lived experiences. Most of the tasks in the course dont require the use of AI since we will mainly ask for you to share your own thoughts.</p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">Why Participate?</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">-<strong>Prepare for the future</strong>by deepening your understanding of the Finnish work environment.</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">-<strong>Flexible learning</strong>that fits around your schedule, accessible anywhere with an internet connection.</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">-<strong>Certificate of completion</strong>, showcasing your initiative and willingness to learn beyond the traditional curriculum.</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">-<strong>Student testimonials</strong>: The course has been rated as 9/10 by our past participants! They additionally described the course as exceptionally valuable and comprehensive learning opportunity.</p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">Requirements for Participation:</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">You can be at any stage of your Bachelors or Masters studies to participate in the course. Participants only need an internet connection, a mobile device or computer access, and interest in learning more about Finnish working life. Every student interested on the topic can join.</p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">Enrollment Details:</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">Enroll now and take the first step towards expanding your knowledge and potential in the Finnish working environment.</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\"><strong>Join here and follow the instructions:</strong></p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\"><a style=\"color: #4e008e\" href=\"https://moodle.tuni.fi/course/view.php?id=52336\"><strong>Course: NN00HJ18-3001 Start to Finnish | TUNI Moodle</strong></a><strong>(</strong>HAKA-login)</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\"><strong>Enrollment key:</strong></p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">Starttofinnish</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\"></p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">Study credits</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">It is possible to get 1 credit (ECTS) from completing the course after you get the Certificate of completion. You can find the instructions about getting study credit on the Start to Finnish -moodle.</p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">Further Information:</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">The course is moderated and designed by Akava, the Confederation of Unions for Professional and Managerial Staff in Finland, in co-operation with universities and universities of applied sciences across the country. For additional questions, please contact the course admin Jutta Linna (<a class=\"spamspan\" style=\"color: #4e008e\" href=\"mailto:jutta.linna@akava.fi\">jutta.linna@akava.fi</a>).</p>\r\n\r\n</div>','Student: Join Start to Finnish  A Course on Finnish Working Life','','trash','open','open','','__trashed','','','2025-06-09 03:24:25','2025-06-09 03:24:25','',0,'http://meponetv1.local/?p=81',0,'post','',0);
