INSERT INTO `wp_posts` VALUES (91,1,'2025-06-09 04:21:14','2025-06-09 04:21:14','<span class=\"sc-kzkBiZ cBefDx\" style=\"line-height: 1.875rem;font-weight: bold;font-size: 1.25rem;margin: 1.25rem 0px;color: #000000\">VIOLENCE, WAR, AND SUFFERING</span>\r\n<div class=\"sc-kpDqfm bUQqyj\" style=\"color: #000000\">\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">The Passages conference series has since 2003 focused on society and the history of everyday life in the premodern world. Our aim is to bring together scholars from diverse fields to study longer term historical continuities and changes between the classical, medieval, and early modern worlds.</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">The next, ninth conference in 13-15 August 2025 focuses on the emotions and suffering associated with violence. The aim is to understand what kinds of emotional and affective responses and experiences violence and war cause in individuals, families, and other communities.</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">More information and registration<a style=\"color: #4e008e\" href=\"https://events.tuni.fi/passages2025/\" target=\"_blank\" rel=\"noopener\"><strong>on the event web site</strong></a><strong>.</strong></p>\r\n\r\n</div>','Passages from Ancient to Medieval and Early Modern Societies IX','','publish','open','closed','','passages-from-ancient-to-medieval-and-early-modern-societies-ix','','','2025-06-09 04:21:14','2025-06-09 04:21:14','',0,'http://meponetv1.local/event/passages-from-ancient-to-medieval-and-early-modern-societies-ix/',0,'event','',0);
