INSERT INTO `wp_posts` VALUES (104,3,'2025-06-09 05:53:31','2025-06-09 05:53:31','<span class=\"sc-kzkBiZ cBefDx\" style=\"line-height: 1.875rem;font-weight: bold;font-size: 1.25rem;margin: 1.25rem 0px;color: #000000\">The 29th European Conference on Advances in Databases and Information Systems.</span>\r\n<div class=\"sc-kpDqfm bUQqyj\" style=\"color: #000000\">\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">The<a style=\"color: #4e008e\" href=\"http://adbis.eu/\">ADBIS</a>series of conferences provide a forum for the dissemination of research accomplishments and promotes interaction and collaboration among the database, information systems, data science, artificial intelligence and machine learning communities from European countries and the rest of the world.</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">More information of the program and registration in the<a style=\"color: #4e008e\" href=\"https://adbis2025.github.io/index.html#overview\">conference web pages</a>.</p>\r\n\r\n</div>','ADBIS 2025','','trash','open','closed','','adbis-2025__trashed','','','2025-06-09 06:04:56','2025-06-09 06:04:56','',0,'http://meponetv1.local/event/adbis-2025/',0,'event','',0);
