INSERT INTO `wp_posts` VALUES (121,4,'2025-06-10 04:30:46','2025-06-10 04:30:46','<span class=\"sc-dGHkRN dfcAXi\" style=\"line-height: 1.875rem;font-weight: bold;font-size: 1.25rem;margin: 1.875rem 0px 1.25rem;color: #000000\">The renewed Students Guide will be published in June. After the update, users will have the same view of student instructions on the public pages of the Students Guide and the intranet. This news article gives key information about the changes.</span>\r\n<div class=\"sc-kpDqfm bUQqyj\" style=\"color: #000000\">\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">One address for all users</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">The Students Guide will have one address that works for both non-logged-in users on public web pages and logged-in users on the intranet. The URLs of the Students Guide pages will change, but the old addresses will be automatically redirected to the new ones.</p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">Better distinction between TAMK and Tampere university Students Guides</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">Both universities will have their own main image, which will be visible on all content pages. On the public web pages, the name of the university will be displayed alongside the main images of the Students Guide, making it easier for users to identify which university\'s instructions they are browsing.</p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">Terminology clarification</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">In the intranet, the name of the Studying section will change to Students Guide. The term Students Handbook will be removed and replaced with the term Instructions for students.</p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">Why the change?</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">The change is based on feedback from users. For example, in intranet user surveys (2020 and 2022), improvements were requested for information findability and the relationship between the intranet and the Students Guide. In the first phase of the update, the landing pages of the Students Guide were removed, and their contents were placed on existing or new content pages.</p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">What will the Students Guide look like in the future?</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">Images of the key changes in the public view of the Students Guide and the intranet. Images are from the test environment, changes are still possible.</p>\r\n\r\n<h3 style=\"margin: 1.25rem 0px;font-size: 24px;line-height: 1.25\">Student\'s Guide on public web pages</h3>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">Capture 1: TAMK\'s Students Guide homepage. Instructions for students and a link to Curricula and course offerings can be found on different tabs of the same view.</p>\r\n\r\n<figure class=\"sc-aXZVg eZfZpg\" style=\"max-width: 100%;height: auto;margin: 1em 0px;font-size: 0.875rem\"><img src=\"https://content-webapi.tuni.fi/image-style/max_1300x1300/proxy/restricted/2025-06/image-1-start-page_tamk_outlines.png?itok=XepTS6nI\" alt=\"\" /></figure>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\"><br />Capture 2: The top navigation includes language selection, easy transition to Tampere University Students Guide, and login to the intranet. Search is found on the right side.</p>\r\n\r\n<figure class=\"sc-aXZVg eZfZpg\" style=\"max-width: 100%;height: auto;margin: 1em 0px;font-size: 0.875rem\"><img src=\"https://content-webapi.tuni.fi/image-style/max_1300x1300/proxy/restricted/2025-06/image-2-top-navigation-and-search_tamk_outlines.png?itok=4r6rhsIT\" alt=\"\" /></figure>\r\n<h3 style=\"margin: 1.25rem 0px;font-size: 24px;line-height: 1.25\"><br />Students Guide in the intranet</h3>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">Capture 3: The Students Guide can be found in the intranet navigation.</p>\r\n\r\n<figure class=\"sc-aXZVg eZfZpg\" style=\"max-width: 100%;height: auto;margin: 1em 0px;font-size: 0.875rem\"><img src=\"https://content-webapi.tuni.fi/image-style/max_1300x1300/proxy/restricted/2025-06/image-3-students-guide-in-intranet_tamk_outlines.png?itok=sdAXKRUR\" alt=\"\" /></figure>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\"></p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">Capture 4: The link to Curricula and course offerings can be found in the info box.</p>\r\n\r\n<figure class=\"sc-aXZVg eZfZpg\" style=\"max-width: 100%;height: auto;margin: 1em 0px;font-size: 0.875rem\"><img src=\"https://content-webapi.tuni.fi/image-style/max_1300x1300/proxy/restricted/2025-06/image-4-link-to-curricula_tamk_outlines.png?itok=gD45jfUo\" alt=\"\" /></figure>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\"><br /></p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">Launch date</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">The launch date will be announced in a separate news article.</p>\r\n\r\n<h2 style=\"margin: 1.25rem 0px;font-size: 32px;line-height: 1.25\">More information</h2>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\"><a class=\"spamspan\" style=\"color: #4e008e\" href=\"mailto:intranet@tuni.fi\">intranet@tuni.fi</a></p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\">Previously published news:</p>\r\n<p style=\"line-height: 1.75;margin: 0px 0.625rem 0.625rem 0px\"><a style=\"color: #4e008e\" href=\"https://intra.tuni.fi/en/content/news/62706\">We are redesigning the Students Guide to make it more user-friendly</a>(4.2.2025)</p>\r\n\r\n</div>','Renewed Students Guide will be published in the near future','','publish','open','open','','renewed-students-guide-will-be-published-in-the-near-future','','','2025-06-10 04:30:46','2025-06-10 04:30:46','',0,'http://meponetv1.local/renewed-students-guide-will-be-published-in-the-near-future/',0,'post','',0);
